const Input = ({ fieldName, type = "text", label }) => {
  return (
    <div className="form-group">
      <label for="name" className="form-label">
        Name
      </label>
      <input
        type="text"
        className="form-control"
        id="name"
        placeholder="Enter name"
      />
    </div>
  );
};

export default Input;
